// @ts-nocheck
import React, { ReactNode, HTMLAttributes } from 'react';
import { createComponent } from '../lib';
import type { JSX } from '@vime/core/dist/types';

import { 
  VmSkeleton 
} from '@vime/core';

import { define } from '../lib';


define('vm-skeleton', VmSkeleton);


export interface SkeletonProps extends JSX.VmSkeleton, HTMLAttributes<HTMLVmSkeletonElement> {
  children?: ReactNode | ReactNode[]
};

export default createComponent<HTMLVmSkeletonElement, SkeletonProps>(
  'vm-skeleton',
  new Set(['effect','ready']),
);
